import React from "react";
import "./css/Cadastra.css";

import { useState } from "react";
import axios from "axios";

function onSubmit(e){
    const model = {nome: '', email: ''}
  const [form, setForm] = useState(model)
    e.preventDefault();

    axios.post('http://localhost:8000/cadastro', form);
}

const Cadastra = () => {
  const model = {nome: '', email: ''}
  const [form, setForm] = useState(model)

  const evento = (e) =>{
    let nome = e.target.name;
    let valor = e.target.value;

    setForm({...form, [nome]: valor});
  }

  return (
    <form id="cadastro" className="cadastro" onSubmit={onSubmit}>
      <h1>newsletter</h1>
      <label>
        Nome:
        <input id="nome" name="nome" className="inpt" type="text" onChange={evento} />
      </label>
      <label>
        E-mail:
        <input id="email" name="email" className="inpt" type="text" onChange={evento} />
      </label>

        {/* <p>{form.nome}</p> */}

      <button className="envia" type="button" value="Enviar">
        Salvar
      </button>
    </form>
  );
};

export default Cadastra;
